                            'diplomatique de la Révolution etM. Arthur '
                            'Chuquet, en une série de volumes nourris '
                            'etalertes, son histoire militaire ; M. Pierre de '
                            'la Gorce estentrain de nous retracer son histoire '
                            'religieuse ; M. Al-phonse Aulard a consacré un '
                            'volume considérable à sonhistoire politique ou, '
                            "pour être tout à fait exact, à l'his-toire de "
