                            'Révolutionse sont, neuf fois sur dix, '
                            "singulièrement modifiées encours d'étude. Certes "
                            'je ne me suis nullement refusé ledroit de laisser '
                            'voir mon sentiment sur certains faits etcertains '
                            "hommes ; l'indignation, la pitié ou "
                            "l'admirationfont parfois partie de l'équité. Mais "
                            "il me semble que j'airendu justice à tous, même à "
                            "tel personnage qu'uneétude scrupuleuse me "
                            'dénonçait cependant, en dernièreanalyse, comme un '
                            'malfaiteur conscient ou non.',
